const Detailspage = (props) => {
    //{/*value={firstName} onChange={(e)=>handleChange(e)}*/}
        return (
            <div className="details-Page">
              <h3>{props.name}</h3>
               <div className="details-page-content">
               <p>First Name : {props.name}</p>
               <p>Last Name : {props.name}</p>
               <p>Email : {props.name}</p>
               <p>Phone number : {props.name}</p>
               <p>Sex : {props.sex}</p>
    <div className="btn-container">
    <button onClick={()=> props.handleClick()}className="proceed-btn">Go back</button>
    </div>
    </div>
    </div>
          );
    }
     
    
    export default Detailspage;
